// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract CRTExchange {
    address public owner;  // a ch ca ch s hu hp ng
    mapping(address => string) public roles;  // nh du vai tr ngi dng
    uint public orderCount = 0;  // S lng lnh  c to

    // Cu trc Order (Lnh mua/bn)
    struct Order {
        uint id;           // ID ca lnh
        address user;      // a ch ngi dng to lnh
        bool isBuy;        // true = Mua, false = Bn
        uint amount;       // S lng CRT
        uint price;        // Gi mi CRT (tnh bng Wei)
        bool fulfilled;    // Lnh  c khp hay cha
    }

    // Cu trc Transaction (Lch s giao dch)
    struct Transaction {
        uint orderId;
        address user;
        bool isBuy;
        uint amount;
        uint price;
        uint timestamp;
    }

    // Mng lu lch s giao dch
    Transaction[] public transactionHistory;

    // Mappings  lu tr s d ca ngi dng v cc n hng
    mapping(address => uint) public balances;
    mapping(uint => Order) public orders;

    // Events
    event Deposited(address indexed user, uint amount);  // S kin np CRT
    event Withdrawn(address indexed user, uint amount);  // S kin rt CRT
    event OrderPlaced(uint id, address indexed user, bool isBuy, uint amount, uint price);  // S kin t lnh
    event OrderMatched(uint id, address indexed user);  // S kin khp lnh

    constructor() {
        owner = msg.sender;  // Ngi trin khai hp ng l ch s hu
    }

    //  Np CRT (gi ETH vo hp ng) - ch cho php admin np
    function deposit() public payable {
        require(keccak256(abi.encodePacked(roles[msg.sender])) == keccak256(abi.encodePacked("ADMIN")), "You are not authorized to deposit CRT");
        require(msg.value > 0, "Must send ETH amount greater than 0");
        balances[msg.sender] += msg.value;  // Tng s d ca ngi gi
        emit Deposited(msg.sender, msg.value);  // Ghi li s kin np CRT
    }

    //  Rt CRT (rt ETH t hp ng) - ch cho php admin rt
    function withdraw(uint amount) public {
        require(keccak256(abi.encodePacked(roles[msg.sender])) == keccak256(abi.encodePacked("ADMIN")), "You are not authorized to withdraw CRT");
        require(balances[msg.sender] >= amount, "Insufficient balance");

        balances[msg.sender] -= amount;  // Gim s d ca ngi gi

        // Gi ETH v v ca ngi yu cu rt
        (bool success, ) = msg.sender.call{value: amount}("");
        require(success, "ETH transfer failed");

        emit Withdrawn(msg.sender, amount);  // Ghi li s kin rt CRT
    }

    //  To lnh mua/bn (dnh cho c admin v user)
    function placeOrder(bool isBuy, uint amount, uint price) public {
        require(amount > 0 && price > 0, "Quantity and price must be greater than 0");
        uint total = amount * price;

        // Kim tra nu l lnh mua, ngi dng cn  s d ETH
        if (isBuy) {
            require(balances[msg.sender] >= total, "Insufficient balance to purchase");
        } else {
            // Kim tra nu l lnh bn, ngi dng cn c  CRT  bn
            require(balances[msg.sender] >= amount, "Not enough CRTs to sell");
        }

        orderCount++;  // Tng s lng lnh
        orders[orderCount] = Order(orderCount, msg.sender, isBuy, amount, price, false);  // Lu thng tin lnh
        emit OrderPlaced(orderCount, msg.sender, isBuy, amount, price);  // Ghi li s kin t lnh
    }

    //  Khp lnh mua/bn (dnh cho c admin v user)
    function matchOrder(uint id) public {
        Order storage order = orders[id];
        require(!order.fulfilled, "Order already fulfilled");  // Kim tra lnh  c khp cha
        require(order.user != msg.sender, "Cannot match your own orders");  // Ngi khp khng th khp lnh ca chnh mnh

        uint totalPrice = order.amount * order.price;  // Tnh gi tr tng ca lnh

        if (order.isBuy) {
            // Nu l lnh mua: ngi khp s l ngi bn
            require(balances[msg.sender] >= order.amount, "Not enough CRT to sell");
            require(balances[order.user] >= totalPrice, "Not enough ETH to buy");

            // Ngi mua tr tin cho ngi bn
            balances[order.user] -= totalPrice;
            balances[msg.sender] += totalPrice;

            // Ngi bn chuyn CRT cho ngi mua
            balances[msg.sender] -= order.amount;
            balances[order.user] += order.amount;
        } else {
            // Nu l lnh bn: ngi khp s l ngi mua
            require(balances[msg.sender] >= totalPrice, "Not enough ETH to buy");
            require(balances[order.user] >= order.amount, "Not enough CRT to sell");

            // Ngi mua tr tin cho ngi bn
            balances[msg.sender] -= totalPrice;
            balances[order.user] += totalPrice;

            // Ngi mua nhn CRT t ngi bn
            balances[order.user] -= order.amount;
            balances[msg.sender] += order.amount;
        }

        // Ghi li giao dch trong lch s
        recordTransaction(order.id, msg.sender, order.isBuy, order.amount, order.price);

        order.fulfilled = true;  // nh du lnh  c khp
        emit OrderMatched(order.id, msg.sender);  // Ghi li s kin khp lnh
    }

    // Ghi li giao dch trong lch s
    function recordTransaction(uint orderId, address user, bool isBuy, uint amount, uint price) private {
        transactionHistory.push(Transaction(orderId, user, isBuy, amount, price, block.timestamp));
    }

    //  Ly lch s giao dch
    function getTransactionHistory() public view returns (Transaction[] memory) {
        return transactionHistory;
    }

    //  Ly s d ca ngi dng
    function getBalance(address user) public view returns (uint) {
        return balances[user];
    }

    //  Cp nht vai tr ca ngi dng
    function setRole(address user, string memory role) public {
        require(msg.sender == owner, "Only the owner can set roles");  // Ch ch s hu hp ng mi c th thay i vai tr
        roles[user] = role;
    }
}
